import styled from 'styled-components'

export const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100vw;
  height: 100vh;
  padding: 5vh 10vh;
`;

export const Title = styled.h1`
  margin-bottom: 20px;
  font-size: 32px;
`;

export const ProgramContainer = styled.div`

`
